import React, { useState } from 'react';
import { Bar, Line, Bubble } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, BarElement, PointElement, LineElement, Title, Tooltip, Legend);

const Dashboard = () => {
  const [clicked, setClicked] = useState({});

  const moodLabels = ['Happy', 'Sad', 'Angry', 'Anxious', 'Calm', 'Excited', 'Tired'];

  const moodData = {
    labels: moodLabels,
    datasets: [
      {
        label: 'Mood Count',
        data: [12, 4, 3, 5, 8, 10, 6],
        backgroundColor: [
          'rgba(255, 182, 193, 0.6)',
          'rgba(255, 160, 180, 0.6)',
          'rgba(255, 105, 180, 0.6)',
          'rgba(255, 192, 203, 0.6)',
          'rgba(255, 200, 220, 0.6)',
          'rgba(255, 170, 200, 0.6)',
          'rgba(255, 150, 190, 0.6)',
        ],
      },
    ],
  };

  const lineData = {
    labels: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun'],
    datasets: [
      { label: 'Mood Trend', data: [5, 8, 6, 9, 7, 8], borderColor: 'rgba(255, 182, 193, 0.8)', fill: false },
    ],
  };

  const bubbleData = {
    datasets: [
      {
        label: 'Your Days So Far',
        data: [
          { x: 10, y: 20, r: 15 },
          { x: 20, y: 30, r: 20 },
          { x: 30, y: 40, r: 25 },
        ],
        backgroundColor: 'rgba(255, 182, 193, 0.6)',
      },
    ],
  };

  const activityData = {
    labels: ['Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec', 'Jan', 'Feb', 'Mar'],
    datasets: [
      {
        label: 'Activity',
        data: [1, 2, 3, 4, 5, 6, 7, 8, 7, 6, 5, 4],
        backgroundColor: (ctx) => {
          const value = ctx.dataset.data[ctx.dataIndex];
          return value > 6 ? 'rgba(255, 105, 180, 0.7)' : value > 3 ? 'rgba(255, 160, 180, 0.7)' : 'rgba(255, 192, 203, 0.7)';
        },
        borderColor: 'rgba(255, 105, 180, 1)',
        borderWidth: 1,
      },
    ],
  };

  const chartOptions = {
    responsive: true,
    maintainAspectRatio: false,
    plugins: { legend: { position: 'top' }, title: { display: false } },
    animation: { duration: 800, easing: 'easeInOutQuad' },
    scales: { y: { beginAtZero: true } },
  };

  const cardClass =
    "bg-pink-50 p-4 rounded-3xl shadow hover:shadow-xl transition-all duration-300 w-full h-72";

  return (
    <div className="min-h-screen bg-gradient-to-br from-pink-50 via-pink-100 to-pink-200 p-4 grid gap-4 md:grid-cols-2">
      {/* Row 1 */}
      <div className={cardClass} onClick={() => setClicked({ mood: !clicked.mood })}>
        <h2 className="text-lg font-bold text-pink-700 mb-2 font-sacramento text-center">
          🌸 Mood Past 7 Days
        </h2>
        <Bar data={moodData} options={chartOptions} />
      </div>

      <div className={cardClass} onClick={() => setClicked({ bubble: !clicked.bubble })}>
        <h2 className="text-lg font-bold text-pink-600 mb-2 font-sacramento text-center">
          💖 Your Days So Far
        </h2>
        <Bubble data={bubbleData} options={chartOptions} />
      </div>

      {/* Row 2 */}
      <div className={cardClass} onClick={() => setClicked({ line: !clicked.line })}>
        <h2 className="text-lg font-bold text-pink-700 mb-2 font-sacramento text-center">
          🌷 Your Mood (6 Months)
        </h2>
        <Line data={lineData} options={chartOptions} />
      </div>

      <div className={cardClass} onClick={() => setClicked({ activity: !clicked.activity })}>
        <h2 className="text-lg font-bold text-pink-700 mb-1 font-sacramento text-center">
          🌸 Activity & Streak
        </h2>
        <div className="flex justify-center text-pink-600 text-xs flex-wrap gap-2">
          <p>Active Days: <strong>12</strong></p>
          <p>Happy: <strong>6</strong></p>
          <p>Sad: <strong>6</strong></p>
          <p>Streak: <strong>8</strong></p>
        </div>
        <Bar
          data={activityData}
          options={{
            ...chartOptions,
            animation: {
              duration: clicked.activity ? 0 : 1000,
              easing: 'easeOutCubic',
            },
          }}
        />
      </div>
    </div>
  );
};

export default Dashboard;
